function App() {
  function calculate(value){
    var x,y,z, w, D;
    x = document.getElementById('length').value;
    y = document.getElementById('width').value;
    z = document.getElementById('height').value;
    D = document.getElementById('measurement').value;



  }


  return (
    <div className="App">
      <label> Unit of measurement</label>
      <select id = "measurement"  onChange = {calculate(this.value)}>
        <option value= "centi">cm</option>
        <option value = "mili">mm</option>
        <option value = "meter">m</option>
      </select>
      <br></br>
    <label>Length </label>
    <input type= "number" id = "length" name = "" />
    <br></br>
    <label>Width </label>
    <input type= "number" id = "width" name = "" />
    <br></br>
    <label>Height </label>
    <input type= "number" id = "height" name = "" />
    <br></br>
    <label> Volume (Cubic Meter) </label>
    <input type= "number" id = "" name = "" readOnly = {true}/>
    <br></br>
    </div>
  );
}

export default App;
